  \"2014-04-24T15:02:48.965406\",\n\t\"name\": \"1992-contaminant-survey-of-the-upper-mississippi-river-national-wildlife-and-fish-refuge-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sediments and tissue samples from five
  areas in and near the Upper Mississippi River National Wildlife and Fish Refuge
  were analyzed for inorganic and organic contaminants in 1992. Tissue residue analysis
  did not indicate uptake of contaminants to levels which may cause acute adverse
  effects to trust resources. Two areas, Wise Lake and Swan Slough, were determined
  to have elevated concentrations of contaminants in sediments. Inorganic contaminants
  in Wise Lake are most likely naturally occurring, and may not be available to wildlife.
  Sediment contamination in Swan Slough is most likely anthropogenic. Two polycyclic
  aromatic hydrocarbons detected in this slough may be present in concentrations which
  may be harmful to benthic organisms, under currently proposed US EPA criteria.\",\n\t\"license_title\":
